<style>


body
{
font-size:20px;
font-family:Lucida Console;
}

.outer
{
-webkit-animation: fadetoblack 0.45s infinite;
-webkit-animation-timing-function:ease-out;
animation: fadetoblack 0.45s infinite;
animation-timing-function:ease-out;
	position: absolute;
    top:0;
    bottom: 0;
    left: 0;
    right: 0;
    margin: auto;
}

.outerrotator {
-webkit-animation: rotating2 30s infinite;
-webkit-animation-timing-function:linear;
animation: rotating2 30s infinite;
animation-timing-function:linear;
	position: absolute;
    top:0;
    bottom: 0;
    left: 0;
    right: 0;
    margin: auto;
}

.rotator1:after{
color:#fff;
content:"EYES SEE";
}
.rotator2:after{
color:#fff;
content:"HANDS TOUCH";
}
.rotator3:after{
color:#fff;
content:"SEMEN IMPREGNATES";
}
.rotator5:after{
color:#fff;
content:"BULLET KILLS";
}
.rotator6:after{
color:#fff;
content:"MOUTH EATS";
}
.rotator7:after{
color:#fff;
content:"MADNESS RETURNS";
}
.rotator1 {
border-width:5mm;
border-style:dotted;
-webkit-animation: rotating1 2s infinite;
-webkit-animation-timing-function:ease-in;
animation: rotating1 2s infinite;
animation-timing-function:ease-in;
}

.rotator2 {
border-width:3mm;
border-style:double;
-webkit-animation: rotating1 2s infinite;
-webkit-animation-delay:0.25s;
-webkit-animation-timing-function:ease-in;
animation: rotating1 2s infinite;
animation-delay:0.25s;
animation-timing-function:ease-in;
}

.rotator3 {
border-width:4mm;
border-style:dotted;
-webkit-animation: rotating1 2s infinite;
-webkit-animation-delay:0.5s;
-webkit-animation-timing-function:ease-in;
animation: rotating1 2s infinite;
animation-delay:0.5s;
animation-timing-function:ease-in;
}

.rotator4 {
border-width:6mm;
border-style:solid;
-webkit-animation: rotating1 2s infinite;
-webkit-animation-delay:0.75s;
-webkit-animation-timing-function:ease-in;
animation: rotating1 2s infinite;
animation-delay:0.75s;
animation-timing-function:ease-in;
}

.rotator5 {
border-width:3mm;
border-style:dashed;
-webkit-animation: rotating1 2s infinite;
-webkit-animation-delay:1s;
-webkit-animation-timing-function:ease-in;
animation: rotating1 2s infinite;
animation-delay:1s;
animation-timing-function:ease-in;
}

.rotator6 {
border-width:4mm;
border-style:solid;
-webkit-animation: rotating1 2s infinite;
-webkit-animation-delay:1.25s;
-webkit-animation-timing-function:ease-in;
animation: rotating1 2s infinite;
animation-delay:1.25s;
animation-timing-function:ease-in;
}

.rotator7 {
border-width:7mm;
border-style:dashed;
-webkit-animation: rotating1 2s infinite;
-webkit-animation-delay:1.5s;
-webkit-animation-timing-function:ease-in;
animation: rotating1 2s infinite;
animation-delay:1.5s;
animation-timing-function:ease-in;

}


.rotator8 {
border-width:5mm;
border-style:double;
-webkit-animation: rotating1 2s infinite;
-webkit-animation-delay:1.75s;
-webkit-animation-timing-function:ease-in;
animation: rotating1 2s infinite;
animation-delay:1.75s;
animation-timing-function:ease-in;
}

.rotatingthing {


	position: absolute;
    top:0;
    bottom: 0;
    left: 0;
    right: 0;
    margin: auto;

	
}

.blackside1 {

	position: absolute;
    top:0;
    bottom: 0;
    left: 650px;
    right: 0;
    margin-top: 0px;
    margin-left: 800px;
	background-color:#000;
}
.blackside2 {

	position: absolute;
    top:0;
    bottom: 0;
    left: 0;
    right: 650px;
    margin-top: 0px;
    margin-right: 800px;
	background-color:#000;
}

@-webkit-keyframes fadetoblack {
from { background-color:#fff; -webkit-opacity:1.0; }
to { background-color:#000; -webkit-opacity:1.0; }
}
@keyframes fadetoblack {
from { background-color:#fff; -webkit-opacity:1.0; }
to { background-color:#000; -webkit-opacity:1.0; }
}

@-webkit-keyframes rotating1 {
	from {
		-webkit-transform: rotate(0deg);

		width:1em;
		height:1em;
		}
	to { -webkit-transform: rotate(25deg); 

		width:70em;
		height:70em;
	}
}

@keyframes rotating1 {
	from {
		transform: rotate(0deg);

		width:1em;
		height:1em;
		}
	to { transform: rotate(25deg); 

		width:70em;
		height:70em;
	}
}

@-webkit-keyframes rotating2 {
	0% { -webkit-transform: rotate(360deg); }
	50% { -webkit-transform: rotate(-360deg); }	
	100% { -webkit-transform: rotate(360deg); }
	}


@keyframes rotating2 {
	0% { transform: rotate(360deg); }
	50% { transform: rotate(-360deg); }	
	100% { transform: rotate(360deg); }
	}




</style>
